class MinStack:    def __init__(self):        """        initialize your data structure here.        """        self.stack = []        self.stack1 = []    def push(self, x):        """        :type x: int        :rtype: void        """        self.stack.append(x)        self.stack1.append(x)        self.stack1.sort()    def pop(self):        """        :rtype: void        """        key = self.stack[-1]        self.stack.pop()        self.stack1.remove(key)    def top(self):        """        :rtype: int        """        return self.stack[-1]    def getMin(self):        """        :rtype: int        """        return self.stack1[0]# Your MinStack object will be instantiated and called as such:# obj = MinStack()# obj.push(x)# obj.pop()# param_3 = obj.top()# param_4 = obj.getMin()